import { Link } from "react-router-dom";
import App from "../App";

export default function Projects() {
  return (
    <div className="view-header">
      Projects
        <Link to="/ProjectFolder/ThreeD">
          <button>3D</button>
        </Link> 
        <Link to="/ProjectFolder/Code">
        <button>Code</button>
        </Link>

    </div>
  );
}
